(1, 'Your quotation for vessel ARIADNE - RFQ-NO ONS-2025-BGA-006 is kindly requested', 'Dear Down Town<br/> We kindly ask your assistance in providing a price quote for ONS-2025-BGA-006 for our vessel ARIADNE at port of Indore in country Indore<br>You may access our online quote system by clicking on below URL.<br>http://localhost/onenorthships/<br>Best Regards<br>AMIT KUMAR<br/>9166945720<br>As agent only<br>Team One North', 63, 0, NULL, NULL),
(2, 'Your quotation for vessel ARIADNE - RFQ-NO ONS-2025-BGA-006 is submitted', 'Dear Admin,<br> Please note that we have submitted the quote as per the above.<br>Best Regards<br>Down Town<br>1231231231<br>vendor live address<br>prafull.patidar@wsisrdev.com', 1, 0, NULL, NULL),
