(5, 'Delivery Note Created', 'dn_created', '##ship_name## // ##po_no## // IMO no ##imo_no## at the port of ##delivey_port## Delivery Date ##delivery_date##/##req_type##', 'Dear All<br>Good day<br>Please note that delivery note is created for the subject PO and attached with this email.<br>\nRIC:- Captain please check the delivery note against the items received and enter your comments in the system upon receipt of goods.<br>\nThanks<br>\nTeam One North', 1),
(6, 'PO Created', 'po_created', 'Vessel-##ship_name## // PO NO -##po_no## // IMO NO -##imo_no## at the Port-##delivey_port## of Delivery Date- ##delivery_date##// ##req_type##', 'Dear ##user_name##<br/> \nGood Day<br/>\nPleased to confirm the orders as per attached to VESSEL ##ship_name##// IMO No-##imo_no## at the port of ##delivey_port## Delivery Date ##delivery_date##/##req_type##, \nKindly supply only A grade quality and please share the pictures before supply.<br/>\nSee attached PO NO- ##po_no## <br/>\nKindly confirm with delivery arrangements, as usual, please use our letter heads for delivery notes without prices and revert with signed/stamped copies of the delivery notes upon delivery, for your reference, please find attached the same<br/>\nPlease ensure, all items are long shelf life, minimum Three months Expiry (Except Yoghurt), Follow safety and hygiene guidelines always, Use Refrigerated trucks, and All Fresh vegetables/ Fruits to be in absolute fresh conditions,<br/>\nPlease send pictures of the delivery items before delivery to the below number WhatsApp always.<br/>\nAgents Details <br/>\n##agent_name## <br/>\n##agent_email## <br/>\n##agent_phone## <br/>\nThis is a NON Alcoholic Vessel, hence please do not supply any alcoholic beverage to vessel or any of its crew, even on private REQUESTS<br/>\nThanks,<br/>\nBest regards,<br/>\n##send_by##<br/>\n##degination##<br/>\n##send_email##<br/>\n##mobile_no##<br/>\nOne North Ships LLC- FZ<br/>\nPO Box 79998 Dubai, UAE<br/>', 1),
(7, 'Delivery Note Signed', 'dn_sign', '##ship_name## // ONS-DN NO ##note_no##// IMO No ##imo_no## at the port of ##port_name## Delivery Date ##delivery_date##/ ##req_type##', 'Dear All<br>Good day<br>Please note that following items are having issues in the delivery of items at port ##port_name## on date ##delivery_date##.<br>\nList of items to be fetched from the masters remark and attached the photos and etc from there in email.<br><br>\nThanks<br>\n##ship_name##<br>\n##company_name##<br>', 1),
(8, 'Invoice Created', 'invoice_created', '##ship_name## // ONS-Invoice NO ##invoice_no##// IMO No ##imo_no## at the port of ##port_name## Delivery Date ##delivery_date##/ ##req_type##', 'Dear All<br>Good day<br>Please find Invoice no ##invoice_no## against the supplies made on date ##delivery_date## to vessel ##ship_name##.<br>Attach the invoice.<br>Thanks<br>##name##<br>##desg##<br>##email##', 1),
(9, 'Stock Updation', 'stock_update', 'Stock Updation', 'Dear ##username##\r\nStock has been Updated. \r\n', 1),
(10, 'RFQ Submission Pending', 'rfq_submission_pending', 'RFQ Submission Pending', 'Dear ##username##<br> RFQ (##rfq_no##) submission is pending, kindly submit to head office admin.', 1),
(12, 'RFQ Send For Quotation', 'send_quote', 'Your quotation for vessel ##ship_name## - RFQ-NO ##rfq_no## is kindly requested', 'Dear ##name##<br/> We kindly ask your assistance in providing a price quote for ##rfq_no## for our vessel ##ship_name## at port of ##port_name## in country ##county##<br>You may access our online quote system by clicking on below URL.<br>##url##<br>Best Regards<br>##user_name##<br/>##phone##<br>As agent only<br>Team One North', 1),
(13, 'Upload Invoice', 'upload_invoice', '##ship_name## // ONS-PO-NO ##po_no## and Invoice No ##invoice_no##// IMO No ##imo_no## at the port of ##port_name## Delivery Date ##delivery_date##/ ##req_type##', 'Dear All<br>Good day<br/>Invoice no ##invoice_no## has been uploaded against the po no ##po_no## of vessel ##ship_name## date of delivery ##delivery_date## port of delivery ##port_name##<br>\nDue date ##due_date##\nInvoice is attached<br>\nThanks<br>\n##vendor_name##<br>\n##address##', 1),
(14, 'Condemned Stock Report', 'condemned_stock', '##ship_name##//IMO No ##imo_no##//date of submition- ##date##//condemned stock', 'Dear All<br>Good day<br>Vessel has submitted the condemnent stock report for the month of ##month## valued ##amount## usd.<br>Attach the report.<br>Thanks<br>\n##ship_name##<br>##master##', 1),
(15, 'Po Cancelled', 'po_cancel', 'Vessel-##ship_name## // PO NO- ##po_no## // IMO No ##imo_no## at the port of ##delivery_port## Delivery Date ##delivery_date##/ ##req_type##//PO Cancelled', 'Dear ##vendor_name##<br>Good day<br>Please cancel the PO no ##po_no## due to the change in vessel schedule.<br>Regret inconvenience cause for the same.<br>Hence please cancel the order and stand down all arrangements for the same.<br><br>Thanks<br>Team One North', 1);
